import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

export default function Login() {
  const [credentials, setCredentials] = useState({ email: "", password: "" });
  const navigate = useNavigate();

  const handleSubmit = async (e) => {
    e.preventDefault();
    const response = await fetch("http://localhost:8000/auth/login", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify({
        email: credentials.email,
        password: credentials.password,
      }),
    });
    const json = await response.json();
    console.log(json);
    if (json.success) {
      localStorage.setItem("authToken", json.authToken);
      // window.location.href = '/inotes';
      navigate("/inotes");
    } else {
      alert("Invalid username or password");
    }
  };

  const onchange = (e) => {
    setCredentials({ ...credentials, [e.target.name]: e.target.value });
  };

  return (
    <>
    <form onSubmit={handleSubmit}>
      <div class="body"></div>
      <div class="grad"></div>
      <div class="header">
        <div>
          i<span>Notebook</span>
        </div>
      </div>
      <div class="login">
        <input type="email" placeholder="Email" name="email" id="email" value={credentials.email} onChange={onchange} />
        <input type="password" placeholder="Password" name="password" id="password" value={credentials.password} onChange={onchange} />
        <input type="button" value="Login" />
      </div>
      </form>
    </>
  );
}
